import StarIcon from "@mui/icons-material/Star";

const HomeProduct = ({ id, title, price, rating }) => {
  return (
    <div className="HomeProduct">
      <h1>{title}</h1>
      <small>$ {price}</small>
      {Array(rating)
        .fill()
        .map(<></>)}
    </div>
  );
};

export default HomeProduct;
